import React from 'react';
import { Menu } from 'antd';
import {
  AppstoreOutlined,
  HomeOutlined,
  UserOutlined,
  ContainerOutlined,
  MailOutlined,
  LogoutOutlined,
} from '@ant-design/icons';
import { useSelector, useDispatch } from 'react-redux';

const { SubMenu } = Menu;

const Main = () => {
  const { nickname } = useSelector((state) => state.user);
  const dispatch = useDispatch();

  const handleClick = (e) => {
    console.log(e);
  }

  const onClickBtn = () => {
    dispatch({
      type: LOG_OUT_REQUEST
    })
  }

  return (
    <>
      <div style={{ width: '230px', height: '900px', backgroundColor: '#001529' }}>
        <Menu
          onClick={handleClick}
          defaultSelectedKeys={['1']}
          defaultOpenKeys={['']}
          mode="inline"
          theme="dark"
          forceSubMenuRender="true"
        >
          <div style={{ height: '130px', textAlign: 'center' }}>
            <img
              src="https://user-images.githubusercontent.com/39295881/86248913-7f8de080-bbe9-11ea-801a-73f4f426ed0d.png"
              alt="img"
              style={{ width: '150px', marginTop: '10px' }}
            />
          </div>
          <Menu.Item key="1" icon={<HomeOutlined />}>
            Home
          </Menu.Item>
          <Menu.Item key="2" icon={<UserOutlined />}>
            {nickname}님
          </Menu.Item>
          <SubMenu key="sub1" icon={<MailOutlined />} title="공부하냥">
            <Menu.Item key="problem">문제풀이</Menu.Item>
            <Menu.Item key="concept">개념이해</Menu.Item>
            <Menu.Item key="etc">기타</Menu.Item>
            <Menu.Item key="free">지식무료나눔</Menu.Item>
          </SubMenu>
          <SubMenu key="sub2" icon={<AppstoreOutlined />} title="게시판">
            <Menu.Item key="freedom">자유게시판</Menu.Item>
            <Menu.Item key="information">정보게시판</Menu.Item>
            <Menu.Item key="club">동아리·학회</Menu.Item>
            <Menu.Item key="ettc">기타게시판</Menu.Item>
          </SubMenu>
          <Menu.Item key="inquiry" icon={<ContainerOutlined />}>
            문의하기
          </Menu.Item>
          <Menu.Item key="logout" icon={<LogoutOutlined />}>
            <button type="button" onClick={onClickBtn} style={{ backgroundColor: 'transparent' }}>로그아웃</button>
          </Menu.Item>
          <div style={{ height: '200px' }} />
        </Menu>
      </div>
    </>
  );
};
export default Main;
